import './dash_home.css';
import App_navbar from '../nav-bar/Nav-bar';
import Sidebar from '../side-bar/Sidebar';

function Dashboard() {
  return (
    <>
    <App_navbar />
    <div className="main-">
      <Sidebar />
    </div>
    </>
  );
}

export default Dashboard;
